import Nav from './';
import { BrowserRouter, Routes, Route, Router } from "react-router-dom";
import "./App.css";
import Index from "./components/Index";




function App() {
  return (
    <div className="App">

      <BrowserRouter>

          <Nav />

          <Routes>

            <Route path="/" element={ <Index />} />

          </Routes>
          {/* <Footer /> */}

      </BrowserRouter>

    </div>
  );
}

export default App;
